import { Bar } from 'react-chartjs-2';

const BarChart = ({ data, title }) => {
    const getData = () => {
        return {
            labels: ['one', 'two', 'three', 'four'],
            datasets: [
                {
                    label: "test",
                    data: [1, 2, 3, 4],
                    backgroundColor: [
                        "#ffbb11",
                        "#ecf0f1",
                        "#50AF95",
                        "#f3ba2f",
                    ]
                }
            ]
        }
    }
    return (
        <div>
            <Bar
                data={getData()}
                options={{
                    plugins: {
                        title: {
                            display: true,
                            text: {title}
                        },
                        legend: {
                            display: true,
                            position: "bottom"
                        }
                    }
                }}
            />
        </div>
    )
}

export default BarChart;
